import React from "react";

function Login() {
  return (
    <div>
      <form id="login_form">
        <input
          required
          maxlength="15"
          type="text"
          placeholder="Hello, Who are you?"
        />
        <button>Login</button>
      </form>
    </div>
  );
}

export default Login;
